import { Add, Remove } from '@mui/icons-material';
import React from 'react';
import styled from 'styled-components';
import Announcement from '../components/announcements';
import Footer from '../components/footer';
import Navbar from '../components/navbar';

const Container=styled.div`

`
const Wrapper=styled.div`
    height:100vh;
    width: 100vw;
`
const Title=styled.h1`
    text-align: center;
`
const Top=styled.div`
    display:flex;
    justify-content: space-between;
    align-items: center;
`
const Bottom=styled.div`
    display:flex;
    flex-direction: row;
    height:100vh;
    width:100vw;

`
const TopButton=styled.button`
    width:130px;
    height:40px;
    margin:20px;
    border:${props=>props.type==='filled' && 'none'};
    background-color: ${props=>props.type==='filled'?'black':'transparent'};
    color:${props=>props.type==='filled' && 'white'};
    cursor:pointer;
`
const Toptext=styled.span`
    text-decoration: underline;
    cursor: pointer;
`
const Info=styled.div`



    display:flex;
    flex-direction: row;
    align-items: center;
    margin-bottom: 30px;
    margin-top:30px ;
`

const Productdetail=styled.div`

    margin: 20px;
    display: flex;
    flex-direction: column;
    font-size:20px;
`
const Image=styled.img`
        height: 166px;
        width: 265px;
`        
const Productname=styled.div`

`
const Productid=styled.div`

`
const Productcolor=styled.div`
    width:20px;
    height:20px;
    border-radius: 50%;
    background-color: ${props=>props.color};
`
const Productsize=styled.div`

`
const Pricedetail=styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`
const Productamountcontainer=styled.div`
    display: flex;
    flex-direction: row;
    align-items:center;
    justify-content: center;
`
const Productamount=styled.div`
    border: 2px solid maroon;
    border-radius: 5px;
    height: 30px;
    width:30px;
    display :flex;
    align-items: center;
    justify-content: center;
    margin:10px;
    font-size: 30px;
`   
const Productprice=styled.h1`
    font-size: 30px;
`
const Productinfo=styled.div`
    flex:2;
`
const Hr=styled.hr`
    background-color:#eee;
    border: none;
    height:1px;
`
const Summary=styled.div`
    flex:1;

    margin-right:20px;
    height:37%;
    width:50%;
    background-color:#eee;
    border-radius:10px;
    box-shadow: 4px 4px 7px;


`
const Summarytitle=styled.h1`
    margin :10px;
`
const Summaryitem=styled.div`
  display:flex;
  justify-content: space-between;
  margin-bottom:20px;
  margin-right: 10px;
  font-size: ${props=>props.type==='total' && "30px"};
  margin-left:10px
`  
const Summaryitemtext=styled.span`

`
const Summaryitemprice=styled.span`

`
const Button=styled.button`
   margin-left:10px; 
   height: 38px;
    width: 94%;
    background-color:black;
    font-size:15px;
    cursor:pointer;
    &:hover{
        background-color: rgba(0,0,0,0.1);
    }
    border :none;
    color:white;
    border-radius: 5px;
`




function Cart(){
    return(
        <Container >
            <Announcement />
            <Navbar/>
            <Wrapper>
                <Title>Your Cart</Title>
                <Top>
                    <TopButton>Continue Shopping</TopButton>
                    <Toptext>Shopping bag(2)</Toptext>
                    <Toptext>Your Cart(0)</Toptext> 
                    <TopButton type='filled'>Checkout</TopButton>
                </Top>
                <Bottom>
                    <Productinfo>
                    <Info>
                    <Image src='https://rukminim1.flixcart.com/image/832/832/xif0q/shoe/y/h/m/7-dj7381-400-8-nike-ashen-slate-black-white-football-grey-original-imagmnc8yhsrndbf.jpeg?q=70'/>
                    <Productdetail>

                            <Productname>
                                <b>Product:</b>NIKE RUNNING
                            </Productname>
                            <Productid><b>ID:</b>NK938738</Productid>
                            <Productcolor color='gray'/>
                            <Productsize><b>SIZE:</b>Uk10</Productsize>

                        </Productdetail>
                        <Pricedetail>
                            <Productamountcontainer>
                                <Add/>
                                <Productamount>2</Productamount>
                                <Remove />
                            </Productamountcontainer>
                            <Productprice>₹6999</Productprice>
                            </Pricedetail>

                    </Info>
                    <Hr/>
                    <Info>
                    <Image src='https://rukminim1.flixcart.com/image/832/832/xif0q/shoe/y/h/m/7-dj7381-400-8-nike-ashen-slate-black-white-football-grey-original-imagmnc8yhsrndbf.jpeg?q=70'/>
                    <Productdetail>

                            <Productname>
                                <b>Product:</b>NIKE RUNNING
                            </Productname>
